import React from 'react'
import './styles.css'
import logo from '../assets/logo.webp'
function Header() {
  return (
    <div className="header">
      <div className='header-brand'>
      <img src={logo} alt="" style={{height:"20px",width:"20px"}}/>
      </div>
    </div>
  )
}

export default Header
